def superDigit(n, k):
    # Write your code here
    # p = int(str(n) * k) # This is way too slow. Will never work for huge nrs. But how?
    p = int(n) # Multiply by k later
    if p % 10 == p:
        return p
    else:
        sum_digits = 0
        for char in str(p):
            sum_digits += int(char)

        return superDigit(sum_digits*k, 1)


if __name__ == '__main__':
    print(superDigit(148, 3))
